import Navbar from "react-bootstrap/Navbar";

export default function Header() {
  return (
    <Navbar expand="lg">
      <Navbar.Brand>
        <FontAwesomeIcon icon={solid("user-secret")} />
        <FontAwesomeIcon icon={regular("coffee")} />
        <FontAwesomeIcon icon={brands("twitter")} />
      </Navbar.Brand>
    </Navbar>
  );
}
